import axios from 'axios';
import React, { useEffect, useState } from 'react'

export default function CartSection() {
    const [productData, setProductsData] = useState([]);
    const [localData, setLocalData] = useState([])
    const getproductData = ()=>{
        const localStorageData = localStorage.getItem("cartItem");
        const parsedData = JSON.parse(localStorageData);
        setLocalData(parsedData)
        const productIds = [];
        parsedData.map((item)=>{
            productIds.push(item.productId);

        });
        console.log(productIds)
        axios({
            url: "http://localhost:3001/product/cartItem/",
            method: "post",
            data: productIds
        }).then((res)=>{
            setProductsData(res.data)
            console.log(res.data)
        }).catch((err)=>{
            console.log(err)
        })
    }
    useEffect(()=>{
        getproductData()
    },[])

  return (
    <>
    <div class="cart-page">
        <div class="container">
            <div class="breadcrumbs">
                <a href=""><span class="inactive-bread">Home</span></a>  <img src="https://img.icons8.com/external-those-icons-lineal-those-icons/24/external-right-arrows-those-icons-lineal-those-icons-1.png"/>  
                <a href=""><span class="active-bread">Cart</span></a>
            </div>
            <div class="cart-wrapper">
                <div class="row">
                    <div className="col-lg-8 col-md-12">
                        <div className='row'>

                            
                            
                        </div>
                    </div>
                    <div class="col-lg-4 col-md-12 mb-4">
                        <div class="price-calcualtor">
                            <div class="coupons">
                                <span>Have Coupons?</span>
                                <div class="coupon-form">
                                    <input type="text" class="coupon-wrap form-input" placeholder="Coupon Code"/>
                                    <button class="btn btn-primary apply">Apply</button>
                                </div>
                            </div>
                            <div class="price-detail-wrap">
                                <div class="price-detail d-flex justify-content-between">
                                    <span> Total Price:  </span>
                                    <span>Rs 566</span>
                                </div>
                                <div class="price-detail d-flex justify-content-between">
                                    <span> Discount </span>
                                    <span class="discount">-Rs 566</span>
                                </div>
                                <div class="price-detail d-flex justify-content-between">
                                    <span> Tax:  </span>
                                    <span>Rs 566</span>
                                </div>
                                <div class="price-detail total-price d-flex justify-content-between">
                                    <span> Sub Total Price </span>
                                    <span class="total">Rs 566</span>
                                </div>
                                <button class="btn btn-primary order-now">Order Now</button>
                                <button class="btn btn-primary bts remove">BACK TO SHOP</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
      
    </>
  )
}
